import psutil
import subprocess
import tkinter as tk
from PIL import Image, ImageTk
import base64
import io

app_name = 'VMAgent.exe'
app_path = r'C:\VMAgent\VMAgent.exe'

base64_image_data = """

"""

class ImageDisplay(tk.Toplevel):
    def __init__(self, master=None, base64_image_data=None):
        super().__init__(master)
        self.overrideredirect(True)
        self.attributes('-topmost', True)
        self.geometry('{0}x{1}+0+0'.format(self.winfo_screenwidth(), self.winfo_screenheight()))

        image_data = base64.b64decode(base64_image_data)
        image = Image.open(io.BytesIO(image_data))

        screen_width = self.winfo_screenwidth()
        screen_height = self.winfo_screenheight()
        self.image = image.resize((screen_width, screen_height), Image.LANCZOS)
        self.photo = ImageTk.PhotoImage(self.image)

        self.label = tk.Label(self, image=self.photo)
        self.label.pack(expand=True, fill=tk.BOTH)

        self.bind('<Escape>', self.hide)

    def hide(self, event=None):
        """Hide the image display and pause the checking."""
        self.withdraw()
        self.master.pause_checks = True
        self.after(300000, self.master.resume_checking)

def is_running(app_name):
    """Check if the app is running."""
    for process in psutil.process_iter(['pid', 'name']):
        if process.info['name'] == app_name:
            return True
    return False

def is_responding(app_name):
    """Check if the app is responding."""
    for process in psutil.process_iter(['pid', 'name']):
        if process.info['name'] == app_name:
            proc = psutil.Process(process.info['pid'])
            try:
                proc_status = proc.status()
                if proc_status == psutil.STATUS_RUNNING and proc.is_running():
                    return True
            except psutil.NoSuchProcess:
                return False
    return False

def kill_app(app_name):
    """Kill all instances of the app."""
    for process in psutil.process_iter(['pid', 'name']):
        if process.info['name'] == app_name:
            try:
                process.kill()
            except psutil.AccessDenied:
                print(f"Access denied when trying to kill {app_name} (PID: {process.info['pid']}). Attempting to kill with taskkill.")
                try:
                    subprocess.run(['taskkill', '/F', '/PID', str(process.info['pid'])], check=True)
                except subprocess.CalledProcessError as e:
                    print(f"Failed to kill {app_name} with taskkill. Error: {e}")
            except psutil.NoSuchProcess:
                print(f"Process {app_name} (PID: {process.info['pid']}) does not exist.")

def run_app(app_path):
    """Run the app if it is not already running."""
    if not is_running(app_name):
        print(f"Starting {app_name}...")
        subprocess.Popen([app_path])
    else:
        print(f"{app_name} is already running. No need to start it again.")

def check_app_status(image_display):
    """Check the status of the app and update the UI accordingly."""
    if image_display.master.pause_checks:
        return

    if not is_running(app_name):
        print(f"{app_name} is not running. Starting it.")
        image_display.deiconify()
        image_display.after(300000, lambda: run_app(app_path))
    elif not is_responding(app_name):
        print(f"{app_name} is not responding. Displaying fullscreen image.")
        kill_app(app_name)
        image_display.deiconify()
        image_display.after(300000, lambda: run_app(app_path))
    else:
        print(f"{app_name} is running and responding.")
        image_display.withdraw()

    image_display.after(1000, lambda: check_app_status(image_display))

def resume_checking():
    """Resume checking the app status."""
    root.pause_checks = False
    image_display.deiconify()
    image_display.after(300000, lambda: check_app_status(image_display))

def main():
    global root, image_display
    root = tk.Tk()
    root.withdraw()
    root.pause_checks = False

    image_display = ImageDisplay(master=root, base64_image_data=base64_image_data)

    root.resume_checking = resume_checking

    check_app_status(image_display)

    root.mainloop()

if __name__ == "__main__":
    main()
